import './App.css';
import {Routes, Route} from "react-router-dom";
import Navbar from './components';
function App() {
  return (

      <div>
        <Navbar/>
        <div id="content">

        </div>
       <Routes>
          <Route path='/about' component={<Navbar/>} ></Route>
          <Route path='/users'></Route>
          <Route path='/'></Route>
       </Routes>
     </div>

  );
}

export default App;
